import React, { useState, useEffect } from "react";
import { Box, Typography, Button, Grid, Avatar } from "@mui/material";

function FileUpload() {
  const [uploadedFiles, setUploadedFiles] = useState([]);

  // Dummy data for testing
  const dummyFiles = [
    { id: 1, name: "File 1", uploader: "User 1", likes: 10 },
    { id: 2, name: "File 2", uploader: "User 2", likes: 5 },
    { id: 3, name: "File 3", uploader: "User 3", likes: 7 },
  ];

  useEffect(() => {
    // Simulate fetching uploaded files from the backend
    setUploadedFiles(dummyFiles);
  }, []);

  return (
    <Box
      sx={{
        maxWidth: 800,
        margin: "auto",
        marginTop: 10,
        padding: 2,
      }}
    >
      <Typography variant="h4" align="center" gutterBottom color="black">
        Uploaded Files
      </Typography>
      <Grid container spacing={2}>
        {uploadedFiles.map((file) => (
          <Grid item xs={4} key={file.id}>
            <Box sx={{ textAlign: "center" }}>
              <Avatar
                alt={file.name}
                src={`https://via.placeholder.com/150?text=${file.name}`}
                sx={{ width: 150, height: 150, margin: "auto" }}
              />
              <Typography
                variant="subtitle1"
                align="center"
                sx={{ marginTop: 1 }}
              >
                {file.name}
              </Typography>
              <Typography
                variant="subtitle2"
                align="center"
              >{`Uploaded by: ${file.uploader}`}</Typography>
              <Typography
                variant="subtitle2"
                align="center"
              >{`Likes: ${file.likes}`}</Typography>
              <Button variant="contained" color="primary" fullWidth>
                Download
              </Button>
            </Box>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
}

export default FileUpload;
